public:
  information_schema:
    role_usage_grants:
      type: view
      view_sql: " SELECT grantor,\n    grantee,\n    object_catalog,\n    object_schema,\n\
        \    object_name,\n    object_type,\n    privilege_type,\n    is_grantable\n\
        \   FROM information_schema.usage_privileges\n  WHERE (grantor::name IN (\
        \ SELECT enabled_roles.role_name\n           FROM information_schema.enabled_roles))\
        \ OR (grantee::name IN ( SELECT enabled_roles.role_name\n           FROM information_schema.enabled_roles));"
